import React, { Component } from 'react';
import { Card, Button, Icon, Divider, Grid, Image, Header, Search, Segment, } from 'semantic-ui-react';
import factory from '../ethereum/factory';
import Layout from '../components/Layout';
import { Link } from '../routes';

class Index extends Component {
  static async getInitialProps() {
    const projects = await factory.methods.getDeployedProjectCampaigns().call();
    const ngos = await factory.methods.getDeployedNGOCampaigns().call();
    const npos = await factory.methods.getDeployedNPOCampaigns().call();
    const care = await factory.methods.getCustomerCareCount().call();
    const pl = projects.length;
    const ngol = ngos.length;
    const npol = npos.length;

    return { pl, ngol, npol, care };
  }

  render() {
    return (
      <Layout>
        <div>
          <Card.Group style={{marginTop: '25px', padding: '50px'}}>
          <Card style={{margin: '25px'}}
             image='data:image/jpeg;base64,'
             header='Project FundRaiser'
             meta='Profitable'
             description='Get FUNDING for your unique ideas by listing your projects, or be an APPROVER.'
             extra={
               <Link route="/projects">
                 <a>
                  <Icon name='usd' />
                  Total {this.props.pl} Projects
                  </a>
               </Link>}
          />
          <Card style={{margin: '25px'}}
             image='data:image/jpeg;base64,'
             header='NGO FundRaiser'
             meta='Non-profit'
             description='Dont stop for a social cause, list your contribution and get funded, or be an APPROVER.'
             extra={
               <Link route='/ngos'>
                 <a>
                    <Icon name='usd' />
                    Total {this.props.ngol} NGO
                 </a>
               </Link>
          }
          />
          <Card style={{margin: '25px'}}
             image='data:image/jpeg;base64,'
             header='Scholarship FundRaiser'
             meta='Personal'
             description='Dont let your dreams settle down for finance and then your dreams will buy others dreams'
             extra={
               <Link route='/npos'>
                   <a>
                    <Icon name='usd' />
                    Total {this.props.npol} NPO
                  </a>
                </Link>
          }
          />
          <Card style={{margin: '25px'}}
             image='data:image/png;base64,'
             header='ADMIN'
             meta='Confidencial'
             description='Admin Control Pannel'
             extra={
               <Link route='/adminfactory'>
                 <a>
                  <Icon name='trademark' />
                  ADMIN
                 </a>
               </Link>
          }
          />
          <Card style={{margin: '25px'}}
             image='data:image/jpeg;base64,'
             header='Customer Care'
             meta='Managing fraud case'
             description='APPROVERS can register any fraud case and admin will mark it as alert'
             extra={
               <Link route='/customercare'>
                 <a>
                    <Icon name='alarm' />
                    {this.props.care} Case
                 </a>
               </Link>
          }
          />
          <Card style={{margin: '25px'}}
             image='data:image/jpeg;base64,'
             header='People Choise'
             meta='Online Voting'
             description='APPROVERS can vote their favourite organisation, To get a huge cash prize for them'
             extra={
               <Link route='/vote'>
                 <a>
                    <Icon name='hand paper' />
                    E-Vote
                 </a>
                </Link>
          }
          />
          </Card.Group>

          <Divider horizontal>
            <Header as='h4'>
              <Icon name='tag' />
              FRAUD MANAGEMENT
            </Header>
          </Divider>

          <div>
            <br />
            <Header as='h1' style={{fontSize: '24sp'}} icon textAlign='center'>
              <Icon name='settings' />
              SAFETY MANAGEMENT
              <Header.Subheader>
                Fully Secured for all moneytary transaction
              </Header.Subheader>
            </Header>
            <br />
            <br />
            <Grid columns={3} divided style={{padding: '20px'}}>
              <Grid.Row>
                <Grid.Column style={{padding: '15px'}}>
                  <Icon name='tag' />
                  <p>Without the prior approval of the APPROVERS the project MANAGER cannot make any transaction and take money.</p>
                </Grid.Column>
                <Grid.Column style={{padding: '15px'}}>
                <Icon name='tag' />
                  <p>APPROVERS can register an complain against that organisation and the ADMIN will then take actions/genarate an alert.</p>
                </Grid.Column>
                <Grid.Column style={{padding: '15px'}}>
                <Icon name='tag' />
                  <p>APPROVERS will vote their favourite organisation for Public Choise. The best organisation will win a huge cash prize</p>
                </Grid.Column>
              </Grid.Row>

              <Grid.Row>
                <Grid.Column>
                  <Icon name='tag' />
                  <p>ADMIN after verifying all the documents will then approve the project/ngo to get funded.</p>
                </Grid.Column>
                <Grid.Column>
                  <Icon name='tag' />
                  <p>Based on Ethereum Blockchian, due to Decentralized nature every data is sucurely stored in-between transaction.</p>
                </Grid.Column>
                <Grid.Column>
                  <Icon name='tag' />
                  <p>All the doccuments are lacated in the IPFS network.</p>
                </Grid.Column>
              </Grid.Row>
            </Grid>
          </div>
        </div>
      </Layout>
    );
  }
}

export default Index;
